	@Test
	void test1() {
		List<Integer> list = Arrays.asList(2, 5, 3, 1);
//										   1  5  3  2
//										   1  2  3  5
		int result = sol.solve(list);
		assertEquals(2, result);
	}
	
	@Test
	void test2() {
		List<Integer> list = Arrays.asList(3, 4, 2, 5, 1);
//										   5  4  2  3  1
//										   5  4  3  2  1	
		int result = sol.solve(list);
		assertEquals(2, result);
	}
	
	@Test
	void test3() {
		List<Integer> list = Arrays.asList(7, 15, 12, 3);

		int result = sol.solve(list);
		assertEquals(2, result);
	}
	
